Component({
  properties: {
      more: String,
      titleBoxColor: {
          type: String,
          value: "#55E6C1"
      },
      titleColor: {
          type: String,
          value: "#000"
      },
      title: {
          type: String,
          value: "最新图片"
      }
  },
  data: {},
  methods: {
      clickMore: function(t) {
          wx.navigateTo({
              url: this.properties.more
          });
      }
  }
});